inLength(3) // sync with Disqus\n  @MaxLength(3000)\n  @IsString()\n  @IsNotEmpty({ message: 'comment content?' })\n  @prop({ required: true, validate: /\\S+/ })\n  content: string\n\n  // user agent\n  @prop({ validate: /\\S+/ })\n  agent?: string\n\n  @Type(() => Author)\n  @ValidateNested()\n  @IsObject()\n  @IsNotEmpty()\n  @IsDefined({ message: 'comment author?' })\n  @prop({ required: true, _id: false })\n  author: Author\n}\n\n@plugin(mongoosePaginate)\n@plugin(AutoIncrementID, generalAutoIncrementIDConfig)\n@modelOptions({\n  // https://typegoose.github.io/typegoose/docs/api/decorators/model-options/#allowmixed\n  options: { allowMixed: Severity.ALLOW },\n  schemaOptions: {\n    timestamps: {\n      createdAt: 'create_at',\n      updatedAt: 'update_at',\n    },\n  },\n})\nexport class Comment extends CommentBase {\n  @prop({ unique: true })\n  id?: number\n\n  // state\n  @IsIn(COMMENT_STATES)\n  @IsInt()\n  @prop({ enum: CommentState, default: CommentState.Published, index: true })\n  state: CommentState\n\n  // likes\n  @IsInt()\n  @prop({ default: 0, index: true })\n  likes: number\n\n  @IsInt()\n  @prop({ default: 0, index: true })\n  dislikes: number\n\n  // IP address\n  @IsIP()\n  @IsOptional()\n  @prop()\n  ip?: string\n\n  // IP location\n  @prop({ default: null, type: Object })\n  ip_location: null | (Partial & { [key: string]: any })\n\n  @prop({ default: Date.now, immutable: true })\n  create_at?: Date\n\n  @prop({ default: Date.now })\n  update_at?: Date\n\n  @ArrayUnique()\n  @IsArray()\n  @prop({ _id: false, default: [], type: () => [ExtendModel] })\n  extends: ExtendModel[]\n}\n\nexport const CommentProvider = getProviderByTypegooseClass(Comment)\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/Blocklist.html":{"url":"classes/Blocklist.html","title":"class - Blocklist","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Clas